import AppsContainer from "@/app/components/AppsContainer";
import CreateButton from "@/components/custom/buttons/CreateButton";
import PageTitle from "@/components/global/PageTitle";
import {moduleName}ListTable from "./{moduleName}ListTable";

export default function {moduleName}sList() {
  return (
    <>
      <PageTitle
        extraItem={
          <CreateButton
            moduleName="{moduleName.toLowerCase()}"
            action="add"
            redirectTo="/{moduleName.toLowerCase()}/add"
          />
        }
        breadcrumbs=[
          { label: "Dashboard", href: "/dashboard" },
          { label: "{moduleName} List", href: "/{moduleName.toLowerCase()}/list" },
        ]
      >
        {moduleName} List
      </PageTitle>
      <AppsContainer title={""} fullView={true} type="bottom">
        <div className="p-4">
          <{moduleName}ListTable />
        </div>
      </AppsContainer>
    </>
  );
}
